import React, {Component} from "react";
import {classNames} from 'primereact/utils';
import {Card} from "primereact/card";
import {Button} from "primereact/button";
import {InputText} from "primereact/inputtext";
import { Messages } from 'primereact/messages';
import { Message } from 'primereact/message';


export class Rents extends Component {

    constructor(props) {
        super(props);

        this.state = {
            id_email:'',
            submitted: false,
            searchValid: false,
        }

        this.searchRent = this.searchRent.bind(this);
        this.hideDialog = this.hideDialog.bind(this);
    }

    onInputChange(e, name) {
        this.state['id_email'] = ((e.target && e.target.value) || '').trim();
    }

    searchRent(){
        this.state.submitted = true;
        if (this.state.id_email) {
            console.log(this.state.id_email.toString());
        } else {

        }
    }

    hideDialog() {
        this.setState({
            submitted: false,
            productDialog: false
        });
    }

    render() {
        return (
            <div style={{width:'80%', margin:'0 auto', marginTop:'40px'}}>
                <Card title="My Rent" footer={this.footerCard}>
                    <div className="col-12 md:col-4">
                        <div style={{ marginTop: '30px', paddingLeft: '.5em' }}>
                            <InputText
                                placeholder='Username'
                                className='p-error'
                                style={{ marginRight: '.25em' }}
                            />
                            <Message severity='error' text='Field is required' />
                        </div>
                        <div className="p-inputgroup">
                            <InputText id="id_email"
                                       onChange={(e) => this.onInputChange(e, 'id_email')}
                                       required autoFocus
                                       className={classNames({ 'p-invalid': this.state.submitted && !this.state.id_email })}/>
                            {this.state.submitted && !this.state.id_email && <small className="p-error">Id or email is required.</small>}
                            <Button icon="pi pi-search" className="p-button-success" onClick={this.searchRent}/>
                        </div>
                    </div>
                </Card>
            </div>
        );
    }
}

export default Rents;
